        // Remove bootstrap classes from the off-canvas menu.
        _removeClasses(offCanvas.getElementsByTagName('a'));
        _removeClasses(offCanvas.getElementsByTagName('li'));
        _removeClasses(offCanvas.getElementsByTagName('ul'));

